def getDiagSize(dataMatrixName):
    """
    Convert datamatrix code name into diagonal size (in meters)
    @param dataMatrixName: codes in [2, 6, 7, 9] NDEV: ajouter le 8
    @return:
    """
    realSizes = {'2': 0.116, '4':0.1875, '5':0.258, '6':0.366, '7': 0.5131, '9':1.34479}
    datamatrixCode = dataMatrixName[0]
    if realSizes.has_key(datamatrixCode):
        return realSizes[datamatrixCode]
    else:
        return 0.11  # old default size

class DataMatrixTopologicalMap(topology.TopologicalMap, object):
    """ container to manage datamatrix topological map (i.e topological map of datamatrix)
    """
    def __init__(self):
        topology.TopologicalMap.__init__(self)
        self.bDebug = False

    def __repr__(self):
        passage = [key for key, ptPassage in self.aWayPoints.iteritems()]
        Vss = [(key, val.aAmersPose6D.keys()) for key, val in self.aVss.iteritems()]
        strToPrint = "TopologicalMap, current globalMap %s, list of Vs = {%s}" % (str(passage), str(Vss))
        return strToPrint

    def __getstate__(self):
        """
        useful for serialization using pickle
        @return: pickleable value representing the object's state
        """
        return self.__dict__

    def __setstate__(self, d):
        """
        useful for serialization using pickle
        @param d: dict
        """
        self.__dict__.update(d)

    def updateAmer(self, strName, aCornersPixels, imageInfo, bDebug=False):
        """
        Update topological map by adding information concerning a datamatrix seen.

        A labeled point is added or updated if already in the topological map based on datamatrix 4corners.

        @param strName: strLabel of the mark
        /// Breakage of api old : : @param aCornersPixels: 4 corners of the datamatrix  (TODO: add 4 corners orders)
        @param aCornersPixels: 6 corners (corners refined)
        @param imageInfo: imageInfo information (.nResolution, etc..) provided by extractorTools
        @param bDebug: if True print debug information if pnp failed
        @return: True if update has been done.
        """
        if len(aCornersPixels) == 4:
            print("WARNING.. now updateAmer requires aCornersRefined")
        if bDebug or self.bDebug:
            print("call of updateAmer(%s, %s, %s)" % (str(strName), str(aCornersPixels), str(imageInfo)))
        rRealSize = getDiagSize(strName)
        pose = imagePnp.getPose(aCornersPixels, imageInfo, rRealSize, frame='Robot') # TODO : utiliser frame robot ici
        if pose is None:
            print("abcdk.datamatrix_topology.updateAmer: pose estimation using pnp failed.. no update")
            if bDebug or self.bDebug:
                print("abcdk.datamatrix_topology.updateAmer: pose estimation using pnp failed.. no update")
            return False
        pose6D = pose.translation[0], pose.translation[1], pose.translation[2], pose.orientation[0], pose.orientation[1], pose.orientation[2]
        self.addPoint6DToLocal(strLabel=strName, aPose=pose6D, nViewedSize=numeric.dist2D(aCornersPixels[0], aCornersPixels[2]), rDiagSize=rRealSize)
        return True

