    def computeRobotPose(self, strLabel, aCornersPixels, imageInfo, bUseTempMap=True, bDebug=False, bLocalVs = False):
        """
        Compute the robot position based on information relative to a datamatrix currently seen.
        @param strLabel: strLabel of the seen mark
        // api breakage : @param aCornersPixels: 4 corners pixel coordinates of the seen mark
        @param aCornersPixels: 6 corners (corners refined)
        @param imageInfo: camera info (see extractortools)
        @param bUseTempMap: Use a temp vectorSpace to do the computation
        @param bDebug: if True print debug information if failure occurs
        @param bLocalVs: TODO: NDEV: documenter.. je n'arrive plus à comprendre ce que c'était !! NDEV @lgeorge
        @return: pose6D (None if failure
        """
        if len(aCornersPixels) == 4:
            print("WARNING.. now computerRobotPose requires aCornersRefined")
        self.strLastUsedAmer = strLabel
        realSize = getDiagSize(strLabel)
        pose = imagePnp.getPose(aCornersPixels, imageInfo, realSize, frame='Robot')  # TODO : utiliser frame=Robot ici
        if pose is None:
            if bDebug or self.bDebug:
                print("abcdk.datamatrix_topology.updateRobotPose: pose estimation using pnp failed.. no updatedone")
            return None

        pose6D = np.array([pose.translation[0], pose.translation[1], pose.translation[2], pose.orientation[0], pose.orientation[1], pose.orientation[2]])
        if bDebug or self.bDebug:
            print("INF: abcdk.datamatrix_topology.updateRobotPose: pose estimation 6D %s" % str(pose6D))
        if bLocalVs: # NDEV :
            res = self.computeLocalRobotPos(strLabel, pose6D, bUseTempMap)
        else:
            res = self.computeRobotPos(strLabel, pose6D, bUseTempMap)
        if bDebug or self.bDebug:
            print("INF: abcdk.datamatrix_topology.updateRobotPose: robotPose %s" % str(res))
        return res
