def draw3DDebug(strImageFileName, strPickle, strDebugFname=None, aForceCorners=None):
    """

    @param strImage: image jpg filename
    @param strPickle: datamatrix information (see extractortool) pickle file
    @return: None
    """
    import extractortools
    import serialization_tools
    import image
    # :type: extractortools.DatamatrixInfos

    if strDebugFname is None:
        strDebugFname = strImageFileName.split('.')[0] + '_debug_3d.jpg'
    datamatrixInformation = serialization_tools.loadObjectFromFile(strPickle)


    nHeight, nWidth = image.getResolutionFromEnum(datamatrixInformation.imageInfo.nResolution)
    colouredImg = np.zeros((nWidth, nHeight, 3), np.uint8)

    if datamatrixInformation.marks == []:
        return
    rDiagSize = getDiagSize(datamatrixInformation.marks[0].strName)
    if aForceCorners is None:
        aCornersPixel = datamatrixInformation.marks[0].aCornersRefinedPixels
    else:
        aCornersPixel = np.array(aForceCorners)
    imagePnp._getPnpDataMatrix(aCornersPixel,
                              datamatrixInformation.imageInfo.nResolution,
                              rDiagSize,
                              bDebug=True,
                              strDebugFname=strDebugFname)

    # merge image/alphachannel:
    import Image
    foreground = Image.open(strDebugFname).convert('RGBA')
    print ("forground %s" % strDebugFname)
    print ("background %s" % strImageFileName)

    background = Image.open(strImageFileName).convert('RGBA')
    #Image.composite(background, foreground, foreground).save(strDebugFname)
    foreground.putalpha(180)
    background.putalpha(0)
    background.paste(foreground, (0,0), foreground)
    background.save(strDebugFname)



